import * as React from "react";
import { Routes, Route, Link } from "react-router-dom";
import Home from './Home';
import Interest from './Interest';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Home/>} />
        <Route path="interest" element={<Interest />} />
      </Routes>
    </div>
  );
}
export default App;
